class Solution:
    def minimumArea(self, grid: List[List[int]]) -> int:
        m, n = len(grid), len(grid[0])
        left, right, top, bottom = n, 0, m, 0

        for i in range(m):
            for j in range(n):
                if grid[i][j] == 1:
                    left = min(left, j)
                    right = max(right, j + 1)
                    top = min(top, i)
                    bottom = max(bottom, i + 1)

        return (right - left) * (bottom - top) if left < n and top < m else 0
